insert into comments values (3, 42, 10, '0',
     'I loved this review without wanting to actually eat anything served. I think I would prefer the autumn menu. It reminded me of when I was in Beijing at the Wanfujing night market a few years ago, and my Chinese friend asked another Chinese passing by with fried starfish on a stick whether is was good. In response, the woman broke off a piece and handed it to her. My friend said it tasted like crab, but it smelled darkly funky and fishy and of course we don''t usually eat the entire hard-shelled crab. But necessity has driven taste before and will again, the way the environment is going.',
     to_timestamp('2022-10-13 0:02', 'YYYY-MM-DD HH24:MI'),
     to_timestamp('2022-10-13 0:02', 'YYYY-MM-DD HH24:MI'),
    'hornbeck');
insert into comments values (2, 49, 11, '0',
     'Paul,<br/><br/>Having a different perspective and/or opinion does not make one a hater. <br/><br/>This is a beautifully written review. And for those of us who cannot dream of a $375 meal either here or in Denmark (not to mention the airfare), it is a lovely escape.',
     to_timestamp('2022-10-13 0:02', 'YYYY-MM-DD HH24:MI'),
     to_timestamp('2022-10-13 0:02', 'YYYY-MM-DD HH24:MI'),
    'fanvsfan');
