insert into comments values (3, 39, 15, '1',
     'Smithie,<br/>I completely agree with you. I enjoyed the escape just as much, and don''t know when I''ll make it there, if at all. I refer to those who seem to ritually pick these pieces apart at the mere mention of a price they can''t rationalize, or the level of detail these artists go to to present something as best they possibly can for the enjoyment of those who are willing to pay to appreciate it.<br/>Those who make it their mission to try and convince we who find this kind of thing wonderful and worthwhile, that we''re selfish and indulgent, that food is for sustenance only, and to remind as that there are "children starving in Africa".<br/>Each to their own, I say. No offense intended, Smithie.',
     to_timestamp('2022-10-13 0:02', 'YYYY-MM-DD HH24:MI'),
     to_timestamp('2022-10-13 0:02', 'YYYY-MM-DD HH24:MI'),
    'bmizerany');
insert into comments values (2, 40, 16, '0',
     'The Iran nuclear deal does nothing but postpone the inevitable.  All it does is postpone Iran? nuclear program for 10 years, then the deal goes away. Than what? Negotiate a new pact? I agree with President Donald J. Trump, the deal needs to be scrapped, and Iran forced back to the bargaining table. The outcome of new deal must include no nuclear weapons ever, withdrawal of Iranian forces from where ever they are in the world, and end their association with Hezbollah. Thank you.',
     to_timestamp('2022-10-13 0:02', 'YYYY-MM-DD HH24:MI'),
     to_timestamp('2022-10-13 0:02', 'YYYY-MM-DD HH24:MI'),
    'pjhyett');
insert into comments values (3, 42, 17, '0',
     'Macron, and every other world leader, must be aware that whatever agreement they think they come to, can and will be undone by the toxic personalities on Fox who Trump gives more credibility to than our intelligence agencies. Mr. Macron will be embarrassed by Trump, sure as everyone else in his coterie has been.',
