     '"WASHINGTON ??President Trump on Tuesday decried the nuclear agreement with Iran as a ?errible deal??that failed to restrain threats from Tehran, but said he would use formal meetings with President Emmanuel Macron of France to discuss whether to preserve it."<br/><br/>I hope he has a good French baby sitter.',
