    'caged');
insert into comments values (2, 31, 23, '1',
     'He needs a war?o distract and to rally people to him.  A war is likely the only way he and his party win the next elections.   I? sure there are republicans who know this but have made a Faustian bargain to hold onto power. In addition it will largely not be their kids in harms way, but the children of the working class.  So they?l be able to ignore the bodies.  As for Trump, he doesn? care who has to go down to satisfy his ego.',
