insert into comments values (3, 42, 30, '0',
     '"All it does is postpone Iran? nuclear program for 10 years, then the deal goes away. Than what? Negotiate a new pact?" .....Where is your brain. If you tear up the deal what are you going to do, negotiate a new pact? Well guess what, whatever your plan is, you can tear up the deal and do it tomorrow, or wait ten years and do exactly the same thing. And if you tear it up tomorrow how are you going to get Russia, China and Europe on board with new sanctions?  Tearing it up would be really really dumb.',
     to_timestamp('2022-10-13 0:02', 'YYYY-MM-DD HH24:MI'),
